each($$(document, "#boards .column>ul"), function(section) { // Checkboxes creation
  var title = section.previousElementSibling,
      tParent = title.parentNode,
      checkNone  = el("input"),  // CheckAll / CheckNone boxes 
      checkAll   = el("input"),
      checkboxes = [];
  if(title.previousElementSibling &&
     title.previousElementSibling.tagName !== "UL") title = title.previousElementSibling;
  checkNone.type = checkAll.type = "checkbox";
  checkNone.title = "Check none";
  checkAll.title  = "Check all";
  checkNone.onclick = function() {
    checkboxes.forEach(function(checkbox) {
      checkbox.checked = false;
    }); return false;
  }; checkAll.onclick = function() {
    checkboxes.forEach(function(checkbox) {
      checkbox.checked = true;
    }); return false;
  }; checkAll.checked = true;
  each($$(section, ".boardlink:not([href=''])"), function(a) {
    var input = document.createElement("input");  // Create Individual Checkboxes
        input.type = "checkbox";
    if(BLOCKED_BOARDS.indexOf(a.title) === -1 &&
       BOARD_REGEXP.test(a.href)) {
      if(checkedBoards.indexOf(a.title) !== -1) input.checked = true;
      checkboxes.push(input);
      boards.push(new Board(a.title, a.href, function() {
        return input.checked; // Encapsulate the Checkbox state in a function wrapper
      }));
    } else input.disabled = true;
    a.parentNode.insertBefore(input, a);
  });
  tParent.insertBefore(checkAll, title);
  tParent.insertBefore(checkNone, checkAll);
}); checkedBoards = null;

